import React from "react";

export default function Home() {
    return (
        <div className="h-[90vh] flex flex-col justify-center items-center bg-gradient-to-r from-orange-500 to-pink-500 text-white text-center">
            <h1 className="text-5xl font-bold mb-4">Welcome to EduTrack AI</h1>
            <p className="text-lg max-w-2xl mb-6">
                A modern e-learning platform inspired by SWAYAM. Explore interactive
                video courses, track your progress, and achieve your learning goals.
            </p>
            <a href="/register" className="bg-white text-orange-600 px-6 py-3 rounded-lg font-semibold shadow hover:bg-gray-200">
                Get Started
            </a>
        </div>
    );
}
